def from_position_to_coordinates(position, x_range, y_range):
    x = position % x_range - x_range/2
    y = -(floor(position/y_range) - y_range/2)

    return x, y


def from_costmap_to_coordinates(costmap, x_range=200, y_range=200, pos_threshold=30, neg_threshold=0):
    # zero_coordinates = list()
    # pos_coordinates = list()
    # neg_coordinates = list()
    yel_coordinates = list()

    for i, value in enumerate(costmap):
    #     if value == 0:
    #         x, y = from_position_to_coordinates(i, x_range, y_range)
    #         zero_coordinates.append([x, y])
    #     if value > 0:
    #         x, y = from_position_to_coordinates(i, x_range, y_range)
    #         pos_coordinates.append([x, y])
        if value > pos_threshold or value < neg_threshold: # 100 or (value < 0 and value > -10):
            x, y = from_position_to_coordinates(i, x_range, y_range)
            yel_coordinates.append([x, y])
        # if value < 0:
        #     x, y = from_position_to_coordinates(i, x_range, y_range)
        #     neg_coordinates.append([x, y])

    # return np.asarray(zero_coordinates), np.asarray(pos_coordinates), np.asarray(neg_coordinates), np.asarray(yel_coordinates)
    return np.asarray(yel_coordinates)

def get_n_obstacles(coordinates):
    db = DBSCAN(eps=5, min_samples=10).fit(coordinates)
    labels = db.labels_

    # Number of clusters in labels, ignoring noise if present.
    n_clusters_ = len(set(labels)) - (1 if -1 in labels else 0)
    # print('Estimated number of clusters: %d' % n_clusters_)
    return n_clusters_


